import NavListItem from '../components/NavListItem'
import navListData from '../data/navListData'
import React from 'react'
import './header.css'
function Header () {
  return (
    <header>
        <a className="logo" href="#"> Movies</a>
       
        <ul className="nav">
          {navListData.map((nav) => {
            return(
                <NavListItem key={nav._id} nav={nav} />
            )})}
        </ul>

    </header>
  )
}

export default Header;
